import React from 'react';
import { Link } from 'react-router-dom';

const Navbar = () => {
  return (
    <nav className="bg-white shadow-lg">
      <div className="container mx-auto px-4">
        <div className="flex justify-between items-center h-16">
          <Link to="/" className="text-xl font-bold">음악학원 관리</Link>
          <div className="flex space-x-4">
            <Link to="/student-registration" className="hover:text-blue-500">학생등록</Link>
            <Link to="/student-management" className="hover:text-blue-500">학생관리</Link>
            <Link to="/class-management" className="hover:text-blue-500">수업관리</Link>
            <Link to="/payment-management" className="hover:text-blue-500">결제관리</Link>
          </div>
        </div>
      </div>
    </nav>
  );
};

export default Navbar;
